import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import logo from "../../images/logo.png";
import "./NavBar.css";

function NavBar() {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const navigate = useNavigate();

  const handleClickLogo = () => {
    navigate("/");
  };

  const toggleDropdown = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };

  const handleNavigate = (date) => {
    navigate(`/inputs/${date}/ConnectionsPage`);
  };

  return (
    <nav className="bg-gray-800">
      <div className="navbars">
        <div className="logo-container">
          <Link to="/" onClick={handleClickLogo}>
            <img src={logo} alt="Logo" className="main-logo" />
          </Link>
        </div>
        <div className="dropdown-container">
          <button onClick={toggleDropdown} className="dropdown-button">Previous Grids</button>
          {isDropdownOpen && (
            <div className="dropdown-menu">
              <div className="dropdown-item">Today</div>
              {['03-15-2024'].map((date, index) => (
          <div
            key={index}
            className="dropdown-item"
            onClick={() => handleNavigate(date)} // Add the onClick event handler here
          >
            {date}
          </div>
        ))}
            </div>
          )}
        </div>
      </div>
    </nav>
  );  
}

export default NavBar;
